# The function is given two strings s1 and s2. 
# Determine if one of the permutations of 
# characters of s1 is a substring of s2, return True / False.

def check_inclusion(s1, s2):
    for indexS2 in range(len(s2)-len(s1)+1):
        subS2, auxS1 = s2[indexS2:indexS2+len(s1)], s1
        for subIndexS2 in range(len(subS2)):
            if subS2[subIndexS2] in auxS1:
                findIndex = auxS1.find(subS2[subIndexS2])
                auxS1 = auxS1[:findIndex] + auxS1[findIndex + 1:]
            else: break
            if auxS1 == '': return True
    return False
                
    




